properties.approved_maps:
The 8 United States Geological Survey (USGS) 1:100,000 scale topographic maps used to determine the boundary of the Upper Cumberland viticultural area are:

(1) Bowling Green, 1985;

(2) Tompkinsville, 1985; photoinspected 1992;

(3) Corbin, 1981;

(4) Nashville, 1984;

(5) Cookeville, 1982;

(6) Oak Ridge, 1979;

(7) McMinnville, 1981; and

(8) Watts Bar Lake, 1981.
